INSERT INTO `contract` VALUES('2','constructies','');
INSERT INTO `disciplines` VALUES('1','WE','wegen','Vormgeving van wegen en kunstwerken, bestaande situatie inclusief te verwijderen en toekomstige situatie met daarin opgenomen wegmeubilair, markering en geleideconstructies. Situatie-, dwars- en lengteprofielen en detailtekeningen.');
INSERT INTO `disciplines` VALUES('2','WA','waterbouw','Vormgeving van waterwegen zoals: rivieren, kanalen, uiterwaarden, oeverbescherming en zeeweringen, inclusief kunstwerken, bestaande situatie inclusief te verwijderen en toekomstige situatie. Situatie-, dwars- en lengteprofielen en detailtekeningen.');
INSERT INTO `disciplines` VALUES('3','SB','spoorbouw','Vormgeving van spoorwegen en kunstwerken, bestaande situatie inclusief te verwijderen en toekomstige situatie. Inclusief breedspoor, smalspoor, tram, metro en lightrail. Situatie-, dwars- en lengteprofielen en detailtekeningen.');
INSERT INTO `disciplines` VALUES('4','GV','groenvoorziening','Vormgeving van landschappelijke en stedelijk groene inrichting van de omgeving ten behoeve van beplantingsplannen, groenbeheerplannen, groenstructuurplannen en dergelijke. Situatie-, dwars- en lengteprofielen en detailtekeningen.');
INSERT INTO `disciplines` VALUES('5','MI','milieu','Vormgeving van (water)bodemsaneringen, inclusief situatie-, dwars- en lengteprofielen en detailtekeningen.');
INSERT INTO `disciplines` VALUES('6','PV','planvorming','Vormgeving van stedenbouwkundige ontwerpen: verkavelingsplannen, inrichtingsplannen, matenplannen en exploitatieplannen.');
INSERT INTO `disciplines` VALUES('7','OI','ondergrondse infrast','Vormgeving van de ondergrondse infrastructuur (kabels en leidingen). Bestaande situatie inclusief te verwijderen en toekomstige situatie. Situatie-, dwars- en lengteprofielen en detailtekeningen.');
INSERT INTO `disciplines` VALUES('8','CO','contructies','Vorm- en wapeningstekeningen van civieltechnische constructies, zoals: brug, tunnel, onderdoorgang, viaduct, sluizencomplex, spoortunnel, faunapassage.');
INSERT INTO `disciplines` VALUES('9','ME','meten','Landmeetkundige tekeningen Bijvoorbeeld: het genereren van een GIS-model op basis van het IMgeo protocol vanuit een NLCS model.');
INSERT INTO `disciplines` VALUES('10','XX','','Onafhankelijk van discipline');
